contracts/SecureVoting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Voting {
    struct Proposal {
        string name; // Nom de la proposition
        uint256 voteCount; // Nombre de votes reçus
    }

    // Mapping pour suivre si une adresse a voté ou non
    mapping(address => bool) public hasVoted;

    // Liste des propositions
    Proposal[] public proposals;

    // Événement pour signaler qu'un vote a été enregistré
    event Voted(address indexed voter, uint256 indexed proposalIndex);

    // Constructor pour initialiser les propositions
    constructor(string[] memory proposalNames) {
        for (uint256 i = 0; i < proposalNames.length; i++) {
            proposals.push(Proposal({
                name: proposalNames[i],
                voteCount: 0
            }));
        }
    }

    // Fonction pour récupérer le nombre total de propositions
    function getProposalCount() public view returns (uint256) {
        return proposals.length;
    }

    // Fonction pour voter pour une proposition
    function vote(uint256 proposalIndex) public {
        require(!hasVoted[msg.sender], "You have already voted.");
        require(proposalIndex < proposals.length, "Invalid proposal index.");

        // Enregistre que l'utilisateur a voté
        hasVoted[msg.sender] = true;

        // Incrémente le compteur de votes de la proposition sélectionnée
        proposals[proposalIndex].voteCount++;

        // Émet l'événement de vote
        emit Voted(msg.sender, proposalIndex);
    }

    // Fonction pour récupérer les détails d'une proposition par son index
    function getProposal(uint256 proposalIndex) public view returns (string memory name, uint256 voteCount) {
        require(proposalIndex < proposals.length, "Invalid proposal index.");

        Proposal storage proposal = proposals[proposalIndex];
        return (proposal.name, proposal.voteCount);
    }

    // Fonction pour récupérer tous les noms des propositions
    function getAllProposals() public view returns (string[] memory) {
        string[] memory proposalNames = new string[](proposals.length);
        for (uint256 i = 0; i < proposals.length; i++) {
            proposalNames[i] = proposals[i].name;
        }
        return proposalNames;
    }
}

